config_version: 1
global:
  auto_save.session: true
  bindings.commands:
    normal:
      J: tab-prev
      K: tab-next
  url.default_page: https://google.com/
  url.searchengines:
    DEFAULT: https://www.google.com/search?q={}&ie=utf-8&oe=utf-8
